export interface ICourseTopic {
  id: string;
  title: string;
  description: string;
  linkToVideo: string;
}
export interface ICourseChapter {
  id: string;
  title: string;
  description: string;
  topics: ICourseTopic[];
}
export interface ICourseItem {
  id: string;
  title: string;
  linkPayment: string;
  flagPayment: boolean;
  topics: ICourseTopic[];
  chapters: ICourseChapter[];
  image: string;
  description: string;
  category: string;
  features: string[];
}

interface IProps {}
const CourseItem: React.FC<IProps> = () => {
  const router = useRouter();

  const { data, isLoading } = useGetCourseQuery(
    {
      id: router?.query?.id,
    },
    {
      skip: !router?.query?.id,
    }
  );
  console.log("data", data);
  if (isLoading || !mockData) {
    <Spinner margin="200px auto" />;
  }

  if (mockData?.flagPayment) {
    return <SellingCourseItem data={mockData} />;
  }
  return <ViewingCourseItem data={mockData} />;
};

export default CourseItem;
